// in config.js
import { createChatBotMessage } from "react-chatbot-kit";
import StocksOptions from "../widgets/StocksOptions";

import ActionProvider from '../ActionProvider';
import MessageParser from '../MessageParser';
const botName = "Fukencio";

const config = {
  initialMessages: [
    createChatBotMessage(`Hola mi nombre es ${botName}.`),
    createChatBotMessage(
      `Estoy aqui para ayudarte a obtener los precios 
      de las empresas en la bolsa de valores, por ejemplo:`,
      {
        withAvatar: false,
        delay: 800,
        widget: "Examples",
      }
    ),
  ],
  botName: botName,
  widgets: [
    {
      widgetName: "Examples",
      widgetFunc: (props) => <StocksOptions {...props} />,
    },
  ],
  actionProvider: (dispatch) => new ActionProvider(createChatBotMessage, dispatch),
  messageParser: (actionProvider) => new MessageParser(actionProvider),
};

export default config;
